content:
@_xahue_ 아놔 그거 개장 직전까지 엄청 고민했는데
대마lsd환각버섯 쪽으로 설정했구,,, 주로 환각제랑 다운 계열 쓴다고 생각하시면 돼요😌
그래서 집에 이상한 그림이 많음

@EAT_RAMEN_DAILY 1. 환각버섯 대한민국 자연에서 안나는걸로 알고있음

2. 난다 해도 '모르고먹었다 구분못했음' 이라 우기면 경찰들이 못잡아감

3. 환각 상태로 수능을 볼 가능성이 높음

@Ko_Aoi_ 대마는 중독성이나 후유증이 다른 마약에 비해 훨신 낮은데다가 각성보단 이완제에 가까운 특성덕분에 사고율도 낮아서 합법인 국가도 있는건데
환각버섯은 잘못먹으면 그냥 죽잖아요
환각이 아니라 저승을 본다니까?

넷플릭스 &lt;환상의 버섯 Fantastic Fungi&gt; 
인류의 뇌가 갑자기 커진 이유를 설명하는 소수설: 환각 버섯을 먹고 갑자기 시냅스 연결이 활발해지며 뇌가 커졌다.
말을 더듬던 이 다큐멘터리는 진행자는 환각 버섯을 과다 복용한 뒤 정상적인 대화가 가능해졌다고 주장한다.

@shuping923 페요테 선인장, 메탄올, 환각버섯 등의 마약류가 들어가는걸로 알고 있습니닼ㅋㅋㅋ...
리카가 죽지 않았고 민트아이의 창립자라는 사실도 이미 알고있는..! 읍읍
V가 다른 루트에서 윽악! 한다는 것도 아는..허헣..
